import React from 'react';
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import PostList from './components/PostList';
import './App.css';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<PostList />}/>
          </Routes>

    </BrowserRouter>


  );
}

export default App;
